import React from 'react';
import TF from './../tficon.svg';
import Keras from './../kerasicon.svg';
import './Skills.css';

const Skills = () => {
	return(
		<div className='ph5'>
			<div className='pa3 tc'>
				<h1>Skills</h1>
			</div>
			<div className='grid-wrapper-skills'>
				<i className="devicon-python-plain-wordmark colored" style={{'font-size':'8em'}}></i>
				<h4>Python</h4>
				<i class="devicon-java-plain-wordmark colored" style={{'font-size':'8em'}}></i>
				<h4>Java</h4>
				<i class="devicon-react-original-wordmark colored" style={{'font-size':'8em'}}></i>
				<h4>React</h4>
				<img src={TF} alt='tf' style={{'width':'8em','height':'7.8em'}}/>
				<h4>Tensorflow</h4>
				<img src={Keras} alt='keras' style={{'width':'8em', 'height':'7.8em'}}/>
				<h4>Keras</h4>
				<i class="devicon-nodejs-plain-wordmark colored" style={{'font-size':'8em'}}></i>
				<h4>Node</h4>
				<i class="devicon-express-original-wordmark colored" style={{'font-size':'8em'}}></i>
				<h4>Express</h4>
			</div>
		</div>

	);
}

export default Skills;
